2fdcf44677281005a68ccd9fe9e7fe77cf2ec1a2.source:
query HomeCollection {
  collections(first: 1, where: {tagSlugIn: ["home"]}) {
    __typename
    nodes {
      __typename
      ...HomeCollectionParts
    }
  }
}
fragment HomeCollectionParts on Collection {
  __typename
  id
  title
  featuredImage {
    __typename
    ...MediaParts
  }
  blocks {
    __typename
    ...BlockParts
    connections {
      __typename
      ... on Post {
        ...ArticleListItemParts
      }
      ... on MediaItem {
        ...MediaParts
      }
      ... on Nug {
        ...NugParts
      }
    }
  }
}
fragment MediaParts on MediaItem {
  __typename
  altText
  caption
  credit
  id
  mediaDetails {
    __typename
    height
    width
  }
  sourceUrl
  title
}
fragment BlockParts on Block {
  __typename
  attributes {
    __typename
    name
    value
  }
  id
  innerHtml
  tagName
  type
}
fragment ArticleListItemParts on Post {
  __typename
  ...ArticleTeaserParts
  editions {
    __typename
    edges {
      __typename
      node {
        __typename
        name
        slug
      }
    }
  }
}
fragment ArticleTeaserParts on Post {
  __typename
  bulletin {
    __typename
    campaign {
      __typename
      id
      logo
      name
      slug
    }
    sponsor {
      __typename
      attribution
      id
      slug
      name
    }
    clientTracking {
      __typename
      article
      elsewhere
      logo
    }
  }
  dateGmt
  featuredImage {
    __typename
    ...MediaParts
  }
  flags {
    __typename
    edges {
      __typename
      node {
        __typename
        name
        slug
      }
    }
  }
  video {
    __typename
    ...VideoParts
  }
  id
  kicker
  link
  postId
  title
  video {
    __typename
    ...VideoParts
  }
  trailerVideo {
    __typename
    ...VideoParts
  }
}
fragment VideoParts on VideoData {
  __typename
  id
  duration
  episode
  playlistId
  season
  type
}
fragment NugParts on Nug {
  __typename
  id
  blocks {
    __typename
    ...BlockParts
    connections {
      __typename
      ... on Post {
        ...ArticleListItemParts
      }
      ... on MediaItem {
        ...MediaParts
      }
    }
  }
  emailLists {
    __typename
    edges {
      __typename
      node {
        __typename
        emailListId
        listId
        name
      }
    }
  }
  title
}

